import {Component} from "react"
import axios from "axios"

class LoginRequest extends Component  {

    componentDidMount(){
        axios.get("http://localhost:3000/login")
        .then(response => {
            console.log(response)
        })
        .catch(error => {
            console.log(error)
        })
    }

}

export default LoginRequest
